import React from 'react';

class Car extends React.Component {
    constructor(props) {
        super(props)
        this.state = {
            color: 'green',
            brand: 'Ford'
        }
    }
    render() {
        return <h2>Hi, I am a {this.props.brand.model} Car!</h2>
    }
}

export default Car;
